##Given a string s that consists of only uppercase English letters,
##you can perform at most k operations on that string.
##In one operation, you can choose any character of the string
##and change it to any other uppercase English character.
##Find the length of the longest sub-string containing all repeating letters you
##can get after performing the above operations.
##Note:
##Both the string's length and k will not exceed 104.
##Example 1:
##Input:
##s = "ABAB", k = 2
##Output:
##4
##Explanation:
##Replace the two 'A's with two 'B's or vice versa.
##Example 2:
##Input:
##s = "AABABBA", k = 1
##Output:
##4
##Explanation:
##Replace the one 'A' in the middle with 'B' and form "AABBBBA".
##The substring "BBBB" has the longest repeating letters, which is 4.


def characterReplacement(s, k):
    if not s or len(s) == 0 or k <0:
        return 0
    if len(s) == 1:
        return 1
    word_dict = {}
    l = 0
    res = 0
    for r in range(len(s)):
        word_dict[s[r]] = word_dict.get(s[r], 0) + 1
        while r - l + 1 - max(word_dict.values()) > k:
            word_dict[s[l]] = word_dict[s[l]] - 1
            l += 1
        res = max(res, r - l + 1)
    return res

def characterReplacement(self, s: str, k: int) -> int:
    # 用字典保存字母出现的次数，需要替换的字符数目＝窗口字符数目－数量最多的字符数目
    letter_num = {}
    l = 0
    res = 0
    for r in range(len(s)):
        # 字典保存字符出现的次数
        letter_num[s[r]] = letter_num.get(s[r], 0) + 1
        # 找到出现次数最多的字符
        max_letter = max(letter_num, key=letter_num.get)
        # 如果替换的字符数目超过给定的k，则移动左边界
        while r - l + 1 - letter_num[max_letter] > k:
            letter_num[s[l]] -= 1
            l += 1
            # 需要更新最多个数的字符
            max_letter = max(letter_num, key=letter_num.get)
        # 如果s[r]　超出了替换的字符数目，需要先处理，再计算结果
        res = max(res, r - l + 1)

    return res



def characterReplacement(s, k):
    if not s or len(s) == 0:
        return 0
    if len(s) == 1:
        return 1
    max_length = 0
    for i in range(len(s)):
        word_dict = {"0": 0}
        j = i
        while j < len(s):
            if s[j] not in word_dict:
                word_dict[s[j]] = 1
            else:
                word_dict[s[j]] += 1
            if sum(word_dict.values()) - max(word_dict.values()) <= k:
                max_length = max(max_length, sum(word_dict.values()))
            else:
                break
            j += 1

    return max_length


print(characterReplacement(""
, 1000))
